\n\nMy outfit \u0026 yoga mat are from: http://www.popflexactive.com\n\n******\n\nCassey Ho is an award-winning fitness instructor, entrepreneur and online personality. As the creator behind Blogilates, the #1 female fitness channel on YouTube, she’s transformed millions of lives through helping them achieve their strength and weight-loss goals. She focuses on making fitness fun and the results are evident. Cassey's unique format, POP Pilates©, which launched as a workout video on YouTube in 2009, has become a live fitness class that can be taken at gyms all over the world with over 3,000 POP Pilates classes being taught monthly. Her authenticity continues to shine through, making her one of the most relatable fitness icons online and beyond. She's also the author of the best-selling book, Hot Body Year Round and is the designer of her own activewear line, POPFLEX.\n\nWith a wide range of free workout videos available, Cassey's channel focuses on ab exercises, butt \u0026 thigh exercises, arm exercises, pilates, cardio routines, fat burning workouts, high intensity interval training workouts (HIIT), stretching and flexibility routines and so much more!\n\n\n***\nDISCLAIMER:\n\nBlogilates and oGorgeous Inc. strongly recommend that you consult with your physician before beginning any exercise program.\n\nYou should be in good physical condition and be able to participate in the exercise.\n\nYou should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Blogilates and oGorgeous Inc. from any and all claims or causes of action, known or unknown, arising out of Blogilates' and oGorgeous Inc.'s negligence.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/C9eK5mSHg gXy","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CIUCEM2rARgBIhMIrPiI2bbthwMVwU-4BB1TMgXy","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CIUCEM2rARgBIhMIrPiI2bbthwMVwU-4BB1TMgXy","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Today is the 10 year anniversary of Blogilates! EEEEEEEE! That's a squeal, btw.\n\nIt is so surreal to think, in 2009, I started uploading videos to YouTube for my pilates students that I thought NO ONE would ever see! I can't believe how lucky I am to be able to be a fitness trainer \u0026 friend to over 4.7 million of you now! \n\nI hope you guys love this look at the past 10 years! It's crazy to see how much has changed (like my hair, haha) and how much has stayed the same (booty taps for life)!\n\nThank you to everyone who stayed with me on this journey, and I can't wait to do more amazing stuff with you guys!\n\nMy first video:    • POP Pilates: Total Body Sculpt Workou...  \n\nHere is where I get all of my music! Epidemic Sound: http://share.epidemicsound.com/sgFTn\n\nMy outfit \u0026 yoga mat are from: http://www.popflexactive.com\n\n******\n\nCassey Ho is an award-winning fitness instructor, entrepreneur and online personality. As the creator behind Blogilates, the #1 female fitness channel on YouTube, she’s transformed millions of lives through helping them achieve their strength and weight-loss goals. She focuses on making fitness fun and the results are evident. Cassey's unique format, POP Pilates©, which launched as a workout video on YouTube in 2009, has become a live fitness class that can be taken at gyms all over the world with over 3,000 POP Pilates classes being taught monthly. Her authenticity continues to shine through, making her one of the most relatable fitness icons online and beyond. She's also the author of the best-selling book, Hot Body Year Round and is the designer of her own activewear line, POPFLEX.\n\nWith a wide range of free workout videos available, Cassey's channel focuses on ab exercises, butt \u0026 thigh exercises, arm exercises, pilates, cardio routines, fat burning workouts, high intensity interval training workouts (HIIT), stretching and flexibility routines and so much more!\n\n\n***\nDISCLAIMER:\n\nBlogilates and oGorgeous Inc. strongly recommend that you consult with your physician before beginning any exercise program.\n\nYou should be in good physical condition and be able to participate in the exercise.\n\nYou should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Blogilates and oGorgeous Inc. from any and all claims or causes of action, known or unknown, arising out of Blogilates' and oGorgeous Inc.'s negligence.","commandRuns":[{"startIndex":628,"length":47,"onTap":{"innertubeCommand":{"clickTrackingParams":"CIUCEM2rARgBIhMIrPiI2bbthwMVwU-4BB1TMgXy","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=WWQtEfZMTB8\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"WWQtEfZMTB8","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr2---sn-5h25gvcg-8j2e.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=59642d11f64c4c1f\u0026ip=177.67.157.112\u0026initcwndbps=100875 EEEEEEEE! That's a squeal, btw.\n\nIt is so surreal to think, in 2009, I started uploading videos to YouTube for my pilates students that I thought NO ONE would ever see! I can't believe how lucky I am to be able to be a fitness trainer \u0026 friend to over 4.7 million of you now! \n\nI hope you guys love this look at the past 10 years! It's crazy to see how much has changed (like my hair, haha) and how much has stayed the same (booty taps for life)!\n\nThank you to everyone who stayed with me on this journey, and I can't wait to do more amazing stuff with you guys!\n\nMy first video:    • POP Pilates: Total Body Sculpt Workou...  \n\nHere is where I get all of my music! Epidemic Sound: http://share.epidemicsound.com/sgFTn\n\nMy outfit \u0026 yoga mat are from: http://www.popflexactive.com\n\n******\n\nCassey Ho is an award-winning fitness instructor, entrepreneur and online personality. As the creator behind Blogilates, the #1 female fitness channel on YouTube, she’s transformed millions of lives through helping them achieve their strength and weight-loss goals. She focuses on making fitness fun and the results are evident. Cassey's unique format, POP Pilates©, which launched as a workout video on YouTube in 2009, has become a live fitness class that can be taken at gyms all over the world with over 3,000 POP Pilates classes being taught monthly. Her authenticity continues to shine through, making her one of the most relatable fitness icons online and beyond. She's also the author of the best-selling book, Hot Body Year Round and is the designer of her own activewear line, POPFLEX.\n\nWith a wide range of free workout videos available, Cassey's channel focuses on ab exercises, butt \u0026 thigh exercises, arm exercises, pilates, cardio routines, fat burning workouts, high intensity interval training workouts (HIIT), stretching and flexibility routines and so much more!\n\n\n***\nDISCLAIMER:\n\nBlogilates and oGorgeous Inc. strongly recommend that you consult with
